function generateNewSingleData(id) {
  const newData = {};
  fetch('https://dog.ceo/api/breeds/image/random')
    .then(res => res.json())
    .then(data => {
      newData.id = id;
      newData.name = `Doggie ${newData.id}`;
      newData.imageUrl = data.message;
      newData.price = Math.floor(Math.random() * 10) + 1;
    });
  return newData;
}

function generateDataCollection(dataArray) {
  for (let i = 0; i < 10; i++) {
    dataArray.push(generateNewSingleData(i + 1));
  }
  return dataArray;
}

export default generateDataCollection;
